  "signal_description": "The query retrieves data from the table 'defaultview-545'. It calculates the 'PO Creation Date' by finding the earliest 'end_time' for events with the name 'Create PO Item' and truncating it to the month. It then calculates the 'Late Payment Rate' by dividing the count of 'CASE_ID' where the 'Last Invoice Due Date' is less than the 'Last Invoice Payment Date' by the count of 'CASE_ID' where the 'Last Invoice Payment Date' is not null, and multiplying it by 100. The result is ordered in ascending order of the 'PO Creation Date' and filled with null values for missing months."
